% SUMO data analysis & eco-indicator application
% -------------------------------------------------------------------------
% Convert .xml files to .txt
files = dir('*.xml');
for i = 1:length(files)
    filename=files(i).name;
    [pathstr, name, ext] = fileparts(filename);
    if contains(name, 'edge') == 1 && contains(name, '_detector_data') == 0
        copyfile(filename, fullfile(pathstr, [name, '_ecoindicator', '.txt']))
    end
end
% -------------------------------------------------------------------------
% Set-up files to run
files = dir('*_ecoindicator.txt');
howmanyfiles = length(files);
howmanygroups = howmanyfiles/3;
% repository = {File_Order_No; Hour; Period; Destination; File_Type; File_Group_Number; Scenario};
repository = zeros(length(files),8);
% Sort files to group them accordingly
for i = 1:howmanyfiles
    repository(i,1) = i;
    filename=files(i).name;
    [pathstr, name, ext] = fileparts(filename);
    % Identify the period associated to each file
    Hour_sort = regexp(name,'[0-9]','match');
    
    Hour_sort = [Hour_sort{1,1} Hour_sort{1,2}];
    repository(i,2) = str2double(Hour_sort);
    
    Period_sort = contains(name,'AM');
    % Period_code: AM = 1; and PM = 2
    if Period_sort == 1
        repository(i,3) = 1;
    else
        repository(i,3) = 2;
    end
    % Identify files routing destination
    % Destination code: Boavista = 1; SaoBento = 2; and A3 = 3
    Dest_sort = contains(name,'Boavista');
    if Dest_sort == 1
        repository(i,4) = 1;
    else
        Dest_sort = contains(name,'SaoBento');
        if Dest_sort == 1
            repository(i,4) = 2;
        else
            repository(i,4) = 3;
        end
    end
    % Identify file type: all vehicles data, routing vehicles data, noise data
    % Group files: 3 respective files -> 1 - All_vehicles_data; 2 - Routing_Vehicles_data; and 3 - Noise_data
    File_Type_sort = contains(name,'noise');
    if File_Type_sort == 1
        repository(i,5) = 3;
    else
        File_Type_sort = contains(name,'edges_All_vehicles');
        if File_Type_sort == 1
            repository(i,5) = 1;
        else
            repository(i,5) = 2;
        end
    end
    % Identify scenario
    scenario_sort = contains(name, '_baseline');
    if scenario_sort == 1
        repository(i,7) = 1;
        repository(i,8) = 0;
    else
        repository(i,7) = 2;
        repository(i,8) = str2double(extractBetween(name,'_solution','_ecoindicator'));
    end
end
group_counter = 1;
for i = 1:howmanygroups
    if i == 1
        Col2_eq_idx = repository(repository(:,2) == repository(i,2));
        Col3_eq_idx = repository(repository(:,3) == repository(i,3));
        Col4_eq_idx = repository(repository(:,4) == repository(i,4));
        Col7_eq_idx = repository(repository(:,7) == repository(i,7));
        Col8_eq_idx = repository(repository(:,8) == repository(i,8));
        all_idx = intersect(intersect(intersect(intersect(Col2_eq_idx,Col3_eq_idx,'stable'),Col4_eq_idx,'stable'),Col7_eq_idx,'stable'),Col8_eq_idx,'stable');
        repository(all_idx(:,1),6) = 1;
    else
        next_element = repository(repository(:,6) == 0);
        Col2_eq_idx = repository(repository(:,2) == repository(next_element(1,1),2));
        Col3_eq_idx = repository(repository(:,3) == repository(next_element(1,1),3));
        Col4_eq_idx = repository(repository(:,4) == repository(next_element(1,1),4));
        Col7_eq_idx = repository(repository(:,7) == repository(next_element(1,1),7));
        Col8_eq_idx = repository(repository(:,8) == repository(next_element(1,1),8));
        all_idx = intersect(intersect(intersect(intersect(Col2_eq_idx,Col3_eq_idx,'stable'),Col4_eq_idx,'stable'),Col7_eq_idx,'stable'),Col8_eq_idx,'stable');
        group_counter = group_counter + 1;
        repository(all_idx(:,1),6) = group_counter;
    end
end
% Reading files
for i = 1:howmanygroups
    read_files_idx = repository(repository(:,6) == repository(i,6));
    all_vehicles_idx = repository(repository(read_files_idx,5) == 1);
    All_Vehicles_data = files(read_files_idx(all_vehicles_idx,1)).name;
    routing_data_idx = repository(repository(read_files_idx,5) == 2);
    Routing_Vehicles_data = files(read_files_idx(routing_data_idx,1)).name;
    noise_idx = repository(repository(read_files_idx,5) == 3);
    Noise_data = files(read_files_idx(noise_idx,1)).name;
    % Start
    raw = readtable(All_Vehicles_data);
    rout = readtable(Routing_Vehicles_data);
    noise = readtable(Noise_data);
    
    % -------------------------------------------------------------------------
    % Raw road traffic data sample reading
    raw = table2cell(raw);
    % raw(1:24,:) = []; -> this only works for files where the first 24
    % lines are unnecessary, which is often NOT the case
    % The solution below, on the other hand, takes into account a varying
    % length initial comment block in the xml
    raw(1:find(contains(raw,'<interval')),:) = [];
    raw(:,2) = [];
    
    raw_filter = contains(raw,'</interval>');
    raw(raw_filter == 1,:) = [];
    raw_filter2 = contains(raw,'</meandata>');
    raw(raw_filter2 == 1,:) = [];
    
    % -------------------------------------------------------------------------
    % Raw routing traffic data sample reading
    rout = table2cell(rout);
    % rout(1:24,:) = []; -> this only works for files where the first 24
    % lines are unnecessary, which is often NOT the case
    % The solution below, on the other hand, takes into account a varying
    % length initial comment block in the xml
    rout(1:find(contains(rout,'<interval')),:) = [];
    rout(:,2) = [];
    
    rout_filter = contains(rout,'</interval>');
    rout(rout_filter == 1,:) = [];
    rout_filter2 = contains(rout,'</meandata>');
    rout(rout_filter2 == 1,:) = [];
    
    % -------------------------------------------------------------------------
    % Raw noise data sample
    noise = table2cell(noise);
    % noise(1:24,:) = []; -> this only works for files where the first 24
    % lines are unnecessary, which is often NOT the case
    % The solution below, on the other hand, takes into account a varying
    % length initial comment block in the xml
    noise(1:find(contains(noise,'<interval')),:) = [];
    noise(:,2) = [];
    
    noise_filter = contains(noise,'</interval>');
    noise(noise_filter == 1,:) = [];
    noise_filter2 = contains(noise,'</meandata>');
    noise(noise_filter2 == 1,:) = [];
    % -------------------------------------------------------------------------
    % Create bins of data
    EdgeID_bin = zeros(numel(raw),1);
    EdgeID_bin = num2cell(EdgeID_bin);
    
    noiseID_bin = zeros(numel(noise),1);
    noiseID_bin = num2cell(noiseID_bin);
    % LaneID_bin = zeros(numel(raw),1);
    Speed_bin = zeros(numel(raw),1);
    ttime_bin = zeros(numel(raw),1);
    NoVehicles_bin = zeros(numel(raw),1);
    noise_bin = zeros(numel(noise),1);
    
    routID_bin = zeros(numel(rout),1);
    routID_bin = num2cell(routID_bin);
    rout_vol_bin = zeros(numel(rout),1);
    % -------------------------------------------------------------------------
    % Data extraction from raw road traffic data sample
    for t = 1:numel(raw)
        EdgeStr = extractBetween(raw(t,:),'<edge id="','" sampledSeconds="');
        EdgeStr = char(EdgeStr);
        ttimeStr = extractBetween(raw(t,:),'" traveltime="','" overlapTraveltime="');
        NoVehiclesStr = extractBetween(raw(t,:),'" entered="','" left="');
        if char(NoVehiclesStr) == '0'
            NoVehiclesStr = extractBetween(raw(t,:),'" left="','" laneChangedFrom="');
        end
        SpeedStr = extractBetween(raw(t,:),'" speed="','" departed="');
        
        Speed_bin(t,1) = str2double(char(SpeedStr));
        EdgeID_bin{t,1} = char(EdgeStr);
        ttime_bin(t,1) = str2double(char(ttimeStr));
        NoVehicles_bin(t,1) = str2double(char(NoVehiclesStr));
    end
    
    Speed_bin(isnan(Speed_bin) == 1) = 0;
    ttime_bin(isnan(ttime_bin) == 1) = 0;
    NoVehicles_bin(isnan(NoVehicles_bin) == 1) = 0;
    % -------------------------------------------------------------------------
    % Data extraction from routing traffic data sample
    for t = 1:numel(rout)
        routIDStr = extractBetween(rout(t,:),'<edge id="','" sampledSeconds="');
        routIDStr = char(routIDStr);
        rout_vol_Str = extractBetween(rout(t,:),'" entered="','" left="');
        if char(rout_vol_Str) == '0'
            rout_vol_Str = extractBetween(rout(t,:),'" left="','" laneChangedFrom="');
        end
        
        routID_bin{t,1} = char(routIDStr);
        rout_vol_bin(t,1) = str2double(char(rout_vol_Str));
    end
    rout_vol_bin(isnan(rout_vol_bin) == 1) = 0;
    % -------------------------------------------------------------------------
    % Data extraction from noise raw data sample
    for r = 1:numel(noise)
        noise_ID = extractBetween(noise(r,:),'<edge id="','" sampledSeconds="');
        noise_ID = char(noise_ID);
        noiseStr = extractBetween(noise(r,:),'" noise="','" traveltime="');
        if isempty(noiseStr) == 1
            noise_bin(r,1) = 0;
        else
            noise_bin(r,1) = str2double(char(noiseStr));
        end
        noiseID_bin{r,1} = char(noise_ID);
    end
