            PM25_diesel = (data(u,2).*0.40) .* (data(u,5)) .* PM25_diesel_ef;
            % Emissions from light commercial vehicles
            CO2_van = (0.20.*data(u,2)) .* (data(u,5)) .* CO2_van_ef;
            CO_van = (0.20.*data(u,2)) .* (data(u,5)) .* CO_van_ef;
            NOx_van = (0.20.*data(u,2)) .* (data(u,5)) .* NOx_van_ef;
            VOCs_van = (0.20.*data(u,2)) .* (data(u,5)) .* VOCs_van_ef;
            PM10_van = (0.20.*data(u,2)) .* (data(u,5)) .* PM10_van_ef;
            PM25_van = (0.20.*data(u,2)) .* (data(u,5)) .* PM25_van_ef;
            % Emissions from buses
            CO2_bus = (0.01.*data(u,2)) .* (data(u,5)) .* CO2_bus_ef;
            CO_bus = (0.01.*data(u,2)) .* (data(u,5)) .* CO_bus_ef;
            NOx_bus = (0.01.*data(u,2)) .* (data(u,5)) .* NOx_bus_ef;
            VOCs_bus = (0.01.*data(u,2)) .* (data(u,5)) .* VOCs_bus_ef;
            PM10_bus = (0.01.*data(u,2)) .* (data(u,5)) .* PM10_bus_ef;
            PM25_bus = (0.01.*data(u,2)) .* (data(u,5)) .* PM25_bus_ef;
            
        else % data(u,3) > 90
            % Petrol light duty vehicles
            CO2_petrol_ef = (-0.0101.*(data(u,3).^2)) + (3.1739.*data(u,3)) - 62.783;
            CO_petrol_ef = (-3E-05.*(data(u,3).^3)) + (0.0098.*(data(u,3).^2)) - (0.1049.*data(u,3)) + 3.2367;
