            VOCs_petrol_ef = (-4E-07.*(data(u,3).^3)) + (0.0001.*(data(u,3).^2)) - (0.0164.*data(u,3)) + 0.7168;
            PM10_petrol_ef = (-2E-07.*(data(u,3).^2)) + (6E-05.*data(u,3)) + 0.0121;
