            % Diesel light duty vehicles
            CO2_diesel_ef =( -0.0126.*(data(u,3).^2)) + (4.0633.*data(u,3)) - 118.65;
            CO_diesel_ef = (1E-09.*(data(u,3).^4)) - (7E-06.*(data(u,3).^3)) + (0.0013.*(data(u,3).^2)) - (0.1049.*data(u,3)) + 3.2367;
            NOx_diesel_ef = (-0.0001.*(data(u,3).^2)) + (0.0334.*data(u,3)) -  1.5687;
            VOCs_diesel_ef = (-2E-08.*(data(u,3).^3)) + (8E-06.*(data(u,3).^2)) - 0.001.*data(u,3) + 0.0586;
            PM10_diesel_ef = (-8E-06.*(data(u,3).^2)) + (0.0026.*data(u,3)) - 0.1201;
            PM25_diesel_ef = (-9E-06.*(data(u,3).^2)) + (0.0027.*data(u,3)) - 0.1291;
            % Light commercial vehicles
            CO2_van_ef = (-0.04.*(data(u,3).^2)) + (11.068.*data(u,3)) - 437.93;
            CO_van_ef = (-0.0096.*(data(u,3).^2)) + (0.0351.*data(u,3)) - 1.6764;
            NOx_van_ef = (-0.0002.*(data(u,3).^2)) + (0.047.*data(u,3)) - 1.9065;
            VOCs_van_ef = (-4E-06.*(data(u,3).^2)) + (0.001.*data(u,3)) + 5E-05;
            PM10_van_ef = (-2E-05.*(data(u,3).^2)) + (0.0063.*data(u,3)) - 0.2775;
            PM25_van_ef = (-2E-05.*(data(u,3).^2)) + (0.0064.*data(u,3)) - 0.2898;
            % Buses
            CO2_bus_ef = (-0.0002.*(data(u,3).^3)) + (0.0962.*(data(u,3).^2)) - (12.779.*data(u,3)) + 1030.1;
            CO_bus_ef = (-6E-07.*(data(u,3).^3)) + (0.0003.*(data(u,3).^2)) - (0.0334.*data(u,3)) + 2.2877;
            NOx_bus_ef = (-2E-06.*(data(u,3).^3)) + (0.0009.*(data(u,3).^2)) - (0.1201.*data(u,3)) + 9.1599;
            VOCs_bus_ef = (-3E-07.*(data(u,3).^3)) + (0.0001.*(data(u,3).^2)) - (0.0162.*data(u,3)) + 0.8522;
            PM10_bus_ef = (5E-09.*(data(u,3).^4)) - (3E-06.*(data(u,3).^3)) + (0.0005.*(data(u,3).^2)) - (0.0445.*data(u,3)) + 1.5733;
            PM25_bus_ef = (3E-09.*(data(u,3).^4)) - (2E-06.*(data(u,3).^3)) + (0.0003.*(data(u,3).^2)) - (0.0297.*data(u,3)) + 1.0865;
            % Pollutants emissions
            % Emissions from petrol light duty vehicles
            CO2_petrol = (data(u,2).*0.39) .* data(u,5) .* (CO2_petrol_ef);
            CO_petrol = (data(u,2).*0.39) .* data(u,5) .* (CO_petrol_ef);
            NOx_petrol = (data(u,2).*0.39) .* data(u,5) .* (NOx_petrol_ef);
            VOCs_petrol = (data(u,2).*0.39) .* data(u,5) .* (VOCs_petrol_ef);
            PM10_petrol = (data(u,2).*0.39) .* data(u,5) .* (PM10_petrol_ef);
            PM25_petrol = (data(u,2).*0.39) .* data(u,5) .* (PM25_petrol_ef);
            % Emissions from diesel light duty vehicles
            CO2_diesel = (data(u,2).*0.40) .* data(u,5) .* CO2_diesel_ef;
            CO_diesel = (data(u,2).*0.40) .* data(u,5) .* CO_diesel_ef;
            NOx_diesel = (data(u,2).*0.40) .* data(u,5) .* NOx_diesel_ef;
            VOCs_diesel = (data(u,2).*0.40) .* data(u,5) .* VOCs_diesel_ef;
            PM10_diesel = (data(u,2).*0.40) .* data(u,5) .* PM10_diesel_ef;
            PM25_diesel = (data(u,2).*0.40) .* data(u,5) .* PM25_diesel_ef;
            % Emissions from light commercial vehicles
            CO2_van = (0.20.*data(u,2)) .* data(u,5) .* CO2_van_ef;
            CO_van = (0.20.*data(u,2)) .* data(u,5) .* CO_van_ef;
            NOx_van = (0.20.*data(u,2)) .* data(u,5) .* NOx_van_ef;
            VOCs_van = (0.20.*data(u,2)) .* data(u,5) .* VOCs_van_ef;
            PM10_van = (0.20.*data(u,2)) .* data(u,5) .* PM10_van_ef;
            PM25_van = (0.20.*data(u,2)) .* data(u,5) .* PM25_van_ef;
            % Emissions from buses
            CO2_bus = (0.01.*data(u,2)) .* data(u,5) .* CO2_bus_ef;
            CO_bus = (0.01.*data(u,2)) .* data(u,5) .* CO_bus_ef;
            NOx_bus = (0.01.*data(u,2)) .* data(u,5) .* NOx_bus_ef;
            VOCs_bus = (0.01.*data(u,2)) .* data(u,5) .* VOCs_bus_ef;
            PM10_bus = (0.01.*data(u,2)) .* data(u,5) .* PM10_bus_ef;
            PM25_bus = (0.01.*data(u,2)) .* data(u,5) .* PM25_bus_ef;
        end
        
        % Results pollutants emissions
        data(u,6) = CO2_petrol + CO2_diesel + CO2_van + CO2_bus;
        data(u,7) = CO_petrol + CO_diesel + CO_van + CO_bus;
        data(u,8) = NOx_petrol + NOx_diesel + NOx_van + NOx_bus;
        data(u,9) = VOCs_petrol + VOCs_diesel + VOCs_van + VOCs_bus;
        data(u,10) = PM10_petrol + PM10_diesel + PM10_van + PM10_bus;
        data(u,11) = PM25_petrol + PM25_diesel + PM25_van + PM25_bus;
        
        % GHG costs
        data(u,12) = ((co2_cost.*(CO2_diesel+CO2_petrol))/data(u,2)) + (vocs_cost.*((VOCs_diesel+VOCs_petrol)/data(u,2)));
        % NOx impacts
        data(u,13) = (nox_cost.*(Pop_zone(traffic_org(u,2),2)/112)).*((NOx_diesel+NOx_petrol)/data(u,2));
        % ---------------------------------------------------------------------
        % Noise cost
        idx_noise = find(noise_org(:,1) == EdgeID(u,1));
        data(u,14) = mean(noise_bin(idx_noise,1));
        idx_CLden = find(abs(CLden_data(:,1)-data(u,14)) == min(abs(CLden_data(:,1)-data(u,14))));
        data(u,15) = (CLden_data(max(idx_CLden),2).*Pop_zone(traffic_org(u,2),2))/(8760.*data(u,2));
        
        % ---------------------------------------------------------------------
        % Traffic congestion evaluation
        if any(data(u,1) == edge_1350PCU)
            VC = data(u,2)/(1350.*data(u,5));
            type = 1;
        elseif any(data(u,1) == edge_2000PCU)
            VC = data(u,2)/(2000.*data(u,5));
            type = 2;
        elseif any(data(u,1) == edge_1400PCU)
            VC = data(u,2)/(1400.*data(u,5));
            type = 1;
        elseif any(data(u,1) == edge_2600PCU)
            VC = data(u,2)/(2600.*data(u,5));
            type = 2;
        elseif any(data(u,1) == edge_1000PCU)
            VC = data(u,2)/(1000.*data(u,5));
            type = 1;
        elseif any(data(u,1) == edge_400PCU)
            VC = data(u,2)/(400.*data(u,5));
            type = 1;
        else %2100PCU
            VC = data(u,2)/(2100.*data(u,5));
            type = 2;
        end
        
        if VC < C(1,2)
            C_Level = C(2,1);
            if type == 1
                cost = C_Urban(1,C_Level);
            else
                cost = C_Highway(1,C_Level);
            end
        elseif VC < C(1,3)
            C_Level = C(2,2);
            if type == 1
                cost = C_Urban(1,C_Level);
            else
                cost = C_Highway(1,C_Level);
            end
        elseif VC < C(1,4)
            C_Level = C(2,3);
            if type == 1
                cost = C_Urban(1,C_Level);
            else
                cost = C_Highway(1,C_Level);
            end
        elseif VC < C(1,5)
            C_Level = C(2,4);
            if type == 1
                cost = C_Urban(1,C_Level);
            else
                cost = C_Highway(1,C_Level);
            end
        else
            C_Level = C(2,5);
            if type == 1
                cost = C_Urban(1,C_Level);
            else
                cost = C_Highway(1,C_Level);
            end
        end
        % Traffic congestion cost
        data(u,16) = (cost.*data(u,2).*data(u,5))/data(u,2);
        
        % ---------------------------------------------------------------------
        % Road crashes evaluation
        % Connect crash data to respective linkID
        examine3 = strtrim(EdgesRead(u,:));
        for c = 1:length(crash_data)
            tf3 = strcmp(examine3, strtrim(crash_data(c,1)));
            if tf3 == 1
                data(u,17) = str2double(crash_data(c,2));
                data(u,18) = str2double(crash_data(c,3));
                data(u,19) = str2double(crash_data(c,4));
                data(u,20) = str2double(crash_data(c,5));
                data(u,21) = str2double(crash_data(c,6));
            end
        end
        % Road crash cost
        data(u,22) = ((data(u,17).*SCf)+(data(u,18).*SCs)+(data(u,19).*SCl))/(8760.*data(u,2).*data(u,5));
        % ---------------------------------------------------------------------
        % Eco_indicator
        data(u,23) = data(u,12) + data(u,13) + data(u,15) + data(u,16) + data(u,22);
        % ---------------------------------------------------------------------
        % Routing vehicles
        rout_idx = find(rout_org(:,1) == EdgeID(u,1));
        data(u,24) = sum(rout_vol_bin(rout_idx,1));
    end
    data(isnan(data) == 1) = 0;
    data(isinf(data) == 1) = 0;
    % -------------------------------------------------------------------------
    % Print results
    header = {'link','cost_co2','cost_co','cost_nox','cost_vocs','cost_pm10','cost_pm25','cost_ghg','cost_nox','cost_noise','cost_tc','cost_rc','cost_emissions_indicator','cost_eco_indicator','totalvehicles','totalrouting','avgspeed','ttime','length'};
    Print = zeros(length(data),19);
