    for a = 1:length(Print)
        Print{a,1} = char(EdgesRead(a,1));
        Print{a,2} = data(a,6);
        Print{a,3} = data(a,7);
        Print{a,4} = data(a,8);
        Print{a,5} = data(a,9);
        Print{a,6} = data(a,10);
        Print{a,7} = data(a,11);
        Print{a,8} = data(a,12);
        Print{a,9} = data(a,13);
        Print{a,10} = data(a,15);
        Print{a,11} = data(a,16);
        Print{a,12} = data(a,22);
        Print{a,13} = data(a,12) + data(a,13);
        Print{a,14} = data(a,23);
        Print{a,15} = data(a,2);
        Print{a,16} = data(a,24);
        Print{a,17} = data(a,3)./3.6;
        Print{a,18} = data(a,4);
        Print{a,19} = data(a,5).*1000;
    end
    % Results writing on initial .txt file
    if repository(read_files_idx(1,1),3) == 1
        period = 'AM';
    else
        period = 'PM';
    end
    if repository(read_files_idx(1,1),7) == 1
        scenario = '_baseline';
    else
        solution_value = num2str(repository(read_files_idx(1,1),8));
        scenario = ['_optimized_', 'solution', solution_value];
    end
    if repository(read_files_idx(1,1),4) == 1
        HOUR = num2str(repository(read_files_idx(1,1),2),2);
        first_number = HOUR(1);
        second_number = HOUR(2);
        results_name = [first_number, period, second_number, period, scenario, '_Routing_Boavista_results.txt'];
    elseif repository(read_files_idx(1,1),4) == 2
        HOUR = num2str(repository(read_files_idx(1,1),2),2);
        first_number = HOUR(1);
        second_number = HOUR(2);
        results_name = [first_number, period, second_number, period, scenario, '_Routing_SaoBento_results.txt'];
    else
        HOUR = num2str(repository(read_files_idx(1,1),2),2);
        first_number = HOUR(1);
        second_number = HOUR(2);
        results_name = [first_number, period, second_number, period, scenario, '_Routing_A3_results.txt'];
    end
    writecell([header;Print], results_name,'Delimiter','\t')
    % -------------------------------------------------------------------------
end
